import React from 'react'
import './mainsection.css'
import { useState,useEffect } from 'react'
function MainSection() {
  const [pictures,setPictures] = useState([])
  useEffect(()=>{
    getPictures()
  },[])
  const getPictures = async () => {
      const allpicturs = await fetch('http://127.0.0.1:8000/api/pictures')
      const data = await allpicturs.json()
      setPictures(data)
  }
  let id, picture1,picture2,picture3;
  {
    
    pictures.map((e) => {
      return  {id, picture1,picture2,picture3} = e
    }
    
    )
  } 
  return (
    <div className='main'>
        <img style={{zIndex: "0", position: "absolute"}} src={picture1} width="100vh" alt="" />
        <img style={{zIndex: "0", position: "absolute"}} src={picture2} width="100vh" alt="" />
        <img style={{zIndex: "0", position: "absolute"}} src={picture3} width="100vh%+"  alt="" />
       
    </div>
  )
}

export default MainSection
